import React from "react";

import { HomePageContainer } from "./homepage.styles";
import "./homepage.styles.sass";

import Directory from "../../components/directory/directory.component";

const HomePage = () => {
  return (
    <HomePageContainer>
      <Directory />
    </HomePageContainer>
  );
};

export default HomePage;
